import React, { useState, useEffect, useContext } from "react";
import { AuthContext } from "./AuthProvider.jsx";
import { Card, Button, Modal } from "react-bootstrap";

function Users() {
  const { token } = useContext(AuthContext);
  const [users, setUsers] = useState([]);
  const [error, setError] = useState("");
  const [selectedUser, setSelectedUser] = useState(null);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await fetch("http://localhost:5000/api/users", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        const data = await response.json();
        if (response.ok) {
          setUsers(data.sort((a, b) => a.id - b.id)); // Sort users by ID
        } else {
          setError(data.message);
        }
      } catch (err) {
        setError("Error during fetching users");
      }
    };
    fetchUsers();
  }, [token]);

  const handleShowModal = (user) => {
    setSelectedUser(user);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setSelectedUser(null);
    setShowModal(false);
  };

  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">Users</h1>
      {error && <p className="text-danger text-center">{error}</p>}
      <div className="row">
        {users.map((user) => (
          <div className="col-md-4 col-sm-6 mb-4" key={user.id}>
            <Card className="h-100 shadow-sm position-relative">
              <Card.Img
                variant="top"
                src={user.profile_picture}
                alt={user.username}
                style={{ height: "200px", objectFit: "cover" }}
              />
              <Button
                variant="link"
                className="position-absolute top-0 end-0 m-2 p-0"
                onClick={() => handleShowModal(user)}
                style={{ zIndex: 1 }}
              >
                <img
                  src="images/icons/expand/expand-32.png"
                  alt="Expand"
                  style={{ width: "24px", height: "24px" }}
                />
              </Button>
              <Card.Body>
                <Card.Title className="text-truncate">{user.username}</Card.Title>
                <Card.Text>Account Level: {user.account_level}</Card.Text>
              </Card.Body>
            </Card>
          </div>
        ))}
      </div>

      <Modal show={showModal} onHide={handleCloseModal} centered>
        {selectedUser && (
          <>
            <Modal.Header closeButton>
              <Modal.Title>{selectedUser.username}</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <img
                src={selectedUser.profile_picture}
                alt={selectedUser.username}
                className="img-fluid mb-3"
                style={{ maxHeight: "300px", objectFit: "cover" }}
              />
              <p>Email: {selectedUser.email}</p>
              <p>Phone Number: {selectedUser.phone_number}</p>
              <p>Given Name: {selectedUser.given_name}</p>
              <p>Family Name: {selectedUser.family_name}</p>
              <p>Date of Birth: {selectedUser.dob}</p>
              <p>Address: {selectedUser.address}</p>
              <p>Account Level: {selectedUser.account_level}</p>
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={handleCloseModal}>
                Close
              </Button>
            </Modal.Footer>
          </>
        )}
      </Modal>
    </div>
  );
}

export default Users;
